import '../../App.css';
import React from 'react';
import HeroSection from '../HeroSection';
import Cards from '../Cards';
import Footer from '../Footer';
import WorkProcess from '../WorkProcess';
import Capability from '../Capability';
import ContactForm from '../ContactForm';
import {Typography, Grid, Container } from '@material-ui/core';
import   { makeStyles } from '@material-ui/core/styles';


const useStyles = makeStyles({
     root: {
          background: 'linear-gradient(45deg, #FE6B8B 30%, #FF8E53 90%)',
          borderRadius: 3,
    border: 0,
    color: 'white',
    height: 48,
    padding: '0 30px',
    boxShadow: '0 3px 5px 2px rgba(255, 105, 135, .3)',
     },
     label:{
          display:'inline-block'
     }
})


function Contact() {
     const classes = useStyles;
	return (



		<div className="contact_container">
    <Grid container direction="row"
  justify="center"
  alignItems="center"
>

     <Grid item xs={6}> 


     <Typography gutterBottom classes={{root: classes.root, label: classes.label}}> Office Address:</Typography>

    <Typography gutterBottom style={{display:'inline-block'}}>C-689, Sarita Vihar, New Delhi 110076</Typography>

    <Typography gutterBottom> Get Project's Budget Estimate
    Communicate With Professional Team</Typography>


     </Grid>
     <Grid item xs={6} >
     <Container maxWidth="sm" style={{ backgroundColor: 'white',padding:'30px' }}>


     <ContactForm/>

</Container>       
     </Grid>
</Grid>


            <Footer />

        </div>



	);
}

export default Contact;
